import React from "react";
import Nav from "./Nav";
import Dashboard from "./Dashboard";
import PatientList from "./Patientsl";
function App() {
  return (
    <div className="m-[0px] w-[1600px] h-[1195] bg-[#f6f7f8]">
      <Nav />
      <div className="grid grid-rows-2 gap-5">
      <Dashboard/>
      <PatientList/>
      </div>






    </div>
  );
}
export default App;
